import {React, useEffect, useState} from 'react';
import RecipeCard from '../RecipeCard';
import './style.css';

const Home = () => {
    const count = 4;
    const [query, setQuery] = useState({
        recipes: [], page: 1
    });
    const [searchMode, setSearchMode] = useState('name');
    const [searchInput, setSearchInput] = useState('');
    const [cuisine, setCuisine] = useState('');
    const [diet, setDiet] = useState('');
    const [time, setTime] = useState('');
    const [unit, setUnit] = useState('');
    const [hasEnded, setHasEnded] = useState(true);

    useEffect(() => {
        fetch(`http://127.0.0.1:8000/userfunction/popular-recipes/?page=${query.page}&count=${count}`)
        .then(response => response.json())
        .then(data => {
            setQuery({...query, recipes: data.results});
            setHasEnded(data.next === null);
        })
    }, [query]);

    const handleSearch = (e) => {
        e.preventDefault();
        let url = 'http://127.0.0.1:8000/userfunction/search/name/';
        if (searchMode === 'name') {
            url += `?name=${searchInput}`;
        }
        if (searchMode === 'creator') {
            url += `?creator=${searchInput}`;
        }
        if (searchMode === 'ingredient') {
            url += `?ingredient=${searchInput}`
        }
        if (cuisine !== '') {
            url += `&cuisine=${cuisine}`
        }
        if (diet !== '') {
            url += `&diet=${diet}`
        }
        if (time !== '' && unit !== '') {
            url += `&time=${time}&unit=${unit}`
        }
        url += `&page=1&count=${count}`
        console.log(url)
        fetch(url)
        .then(data => {
            console.log(data.next)
            setQuery({recipes: data.results, page: 1});
            setHasEnded(data.next === null);
        })
    }

    return (
        <div className="main-container">
            <div className="search row">
                <div className="col d-flex">
                    <div className="col-auto" style={{ width: '30%' }}>
                        <label for="searchmode" style={{ textAlign: 'left', padding: '0', fontWeight: '700' }}>Search By</label>
                        <select className="form-control" id="searchmode" onChange={e => setSearchMode(e.target.value)}>
                            <option value="name">name</option>
                            <option value="creator">creator</option>
                            <option value="ingredient">ingredient</option>
                        </select>
                    </div>
                    <div className="col-auto" style={{ width: '70%' }}>
                        <div className="d-flex" style={{ marginTop: '24px' }}>
                        <input id="search" className="form-control me-2" type="search" placeholder="Enter your search" aria-label="Search" onChange={e => setSearchInput(e.target.value)}/>
                        <button className="btn btn-outline-success" type="submit">Search</button>
                        </div>
                    </div>
                </div>
                <div className="col d-flex">
                    <div className="col-auto" style={{ width: '25%' }}>
                        <div className="row" style={{ marginRight: '0.5em', marginLeft: '0.5em', padding: '0' }}>
                            <label for="cooktime" style={{textAlign: 'left', padding: '0', fontWeight: '700'}}>Cook Time</label>
                            <input type="number" className="form-control" id="cooktime" min="0" placeholder="mins" onChange={e => setTime(e.target.value)}/>
                        </div>
                    </div>
                    <div className="col-auto" style={{ width: '25%' }}>
                        <div className="row" style={{ marginRight: '0.5em', marginLeft: '0.5em', padding: '0' }}>
                            <label for="unit" style={{textAlign: 'left', padding: '0', fontWeight: '700'}}>Time Unit</label>
                            <select className="form-control" id="unit" onChange={e => setUnit(e.target.value)}>
                                <option value="minute">minute</option>
                                <option value="hour">hour</option>
                            </select>
                        </div>
                    </div>
                    <div className="col-auto" style={{ width: '25%' }}>
                        <div className="row" style={{ marginRight: '0.5em', marginLeft: '0.5em', padding: '0' }}>
                            <label for="cuisine" style={{ textAlign: 'left', padding: '0', fontWeight: '700' }}>Cuisine</label>
                            <select className="form-control" id="cuisine" onChange={e => setCuisine(e.target.value)}>
                                <option value="Other">Other</option>
                                <option value="American">American</option>
                                <option value="Chinese">Chinese</option>
                                <option value="Cajun">Cajun</option>
                                <option value="Caribbean">Caribbean</option>
                                <option value="French">French</option>
                                <option value="German">German</option>
                                <option value="Greek">Greek</option>
                                <option value="Hungarian">Hungarian</option>
                                <option value="Indian">Indian</option>
                                <option value="Italian">Italian</option>
                                <option value="Japanese">Japanese</option>
                                <option value="Lebanese">Lebanese</option>
                                <option value="Mediterranean">Mediterranean</option>
                                <option value="Mexican">Mexican</option>
                                <option value="Moroccan">Moroccan</option>
                                <option value="Russian">Russian</option>
                                <option value="Spanish">Spanish</option>
                                <option value="Thai">Thai</option>
                                <option value="Turkish">Turkish</option>
                            </select>
                        </div>
                    </div>
                    <div className="col-auto" style={{ width: '25%' }}>
                        <div className="row" style={{ marginRight: '0.5em', marginLeft: '0.5em', padding: '0' }}>
                            <label for="diet" style={{ textAlign: 'left', padding: '0', fontWeight: '700' }}>Diet</label>
                            <select className="form-control" id="diet" onChange={e => setDiet(e.target.value)}>
                                <option>Other</option>
                                <option>Intermittent Fasting</option>
                                <option>Mediterranean Diet</option>
                                <option>The Ketogenic Diet</option>
                                <option>If It Fits Your Macros</option>
                                <option>Veganism</option>
                                <option>Carnivore Diet</option>
                                <option>Paleo Diet</option>
                                <option>Dessert with Breakfast Diet</option>
                                <option>Sirtfood Diet</option>
                            </select>
                        </div>
                    </div>
                </div>
            </div>
            <div className='recipes-container'>
                {query.recipes.map(recipe => (
                    <RecipeCard recipe={recipe}/>
                ))}
            </div>
            <button disabled={query.page === 1} onClick={() => setQuery({...query, page: query.page - 1})}></button>
            <button disabled={hasEnded} onClick={() => setQuery({...query, page: query.page + 1})}></button>
        </div>
    )
}

export default Home;
